    const {
        color,
        height,
        padding
    } = props

    return (
        <>
            <div className="row">
                <Column style={{
                    backgroundColor: color[0],
                    height: height,
                    padding: padding,
                }}
                    content={
                        <Basemap
                            id='map'
                            mapContainer='map'
                            proxyUrl={proxyUrls[1]}
